/* eslint-disable react/prop-types */

// Soft UI Dashboard React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDAvatar from "components/MDAvatar";
import MDBadge from "components/MDBadge";

// Images
// import logoXD from "assets/images/small-logos/logo-xd.svg";
// import logoAtlassian from "assets/images/small-logos/logo-atlassian.svg";
// import logoSlack from "assets/images/small-logos/logo-slack.svg";
// import logoSpotify from "assets/images/small-logos/logo-spotify.svg";
// import logoJira from "assets/images/small-logos/logo-jira.svg";
// import logoInvesion from "assets/images/small-logos/logo-invision.svg";
import team2 from "assets/images/team-2.jpg";
import team3 from "assets/images/team-3.jpg";
import team4 from "assets/images/team-4.jpg";
import { useDispatch, useSelector } from "react-redux";
import { getAllUsers } from "store/Actions";
import { useEffect, useState } from "react";

function usersData() {
  const [users, setUsers] = useState([]);
  const userAuthReducer = useSelector((state) => state?.userAuthReducer);

  const dispatch = useDispatch();

  const Author = ({ image, name, email }) => (
    <MDBox display="flex" alignItems="center" lineHeight={1}>
      <MDAvatar src={image} name={name} size="sm" />
      <MDBox ml={2} lineHeight={1}>
        <MDTypography display="block" variant="button" fontWeight="medium">
          {name}
        </MDTypography>
        <MDTypography variant="caption">{email}</MDTypography>
      </MDBox>
    </MDBox>
  );

  const Job = ({ title, description }) => (
    <MDBox lineHeight={1} textAlign="left">
      <MDTypography
        display="block"
        variant="caption"
        color="text"
        fontWeight="medium"
      >
        {title}
      </MDTypography>
      <MDTypography variant="caption">{description}</MDTypography>
    </MDBox>
  );

  useEffect(() => {
    dispatch(getAllUsers());
  }, []);

  useEffect(() => {
    if (userAuthReducer?.users?.length > 0) {
      setUsers(userAuthReducer?.users);
    }
  }, [userAuthReducer?.users]);

  useEffect(() => {
    console.log(users);
  }, [users]);
  return {
    columns: [
      { Header: "user", accessor: "user", width: "45%", align: "left" },
      { Header: "usertype", accessor: "usertype", align: "left" },
      { Header: "status", accessor: "status", align: "center" },
      { Header: "JOINED", accessor: "JOINED", align: "center" },
      { Header: "action", accessor: "action", align: "center" },
    ],

    rows: [
      {
        user: (
          <Author
            image={team2}
            name="John Michael"
            email="john@creative-tim.com"
          />
        ),
        usertype: <Job title="Client" description="" />,
        status: (
          <MDBox ml={-1}>
            <MDBadge
              badgeContent="ACTIVE"
              color="success"
              variant="gradient"
              size="sm"
            />
          </MDBox>
        ),
        JOINED: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            23/04/18
          </MDTypography>
        ),
        action: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            Deactivate
          </MDTypography>
        ),
      },
      {
        user: (
          <Author
            image={team3}
            name="Alexa Liras"
            email="alexa@creative-tim.com"
          />
        ),
        usertype: <Job title="Client" description="" />,
        status: (
          <MDBox ml={-1}>
            <MDBadge
              badgeContent="INACTIVE"
              color="dark"
              variant="gradient"
              size="sm"
            />
          </MDBox>
        ),
        JOINED: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            11/01/19
          </MDTypography>
        ),
        action: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            Activate
          </MDTypography>
        ),
      },
      {
        user: (
          <Author
            image={team4}
            name="Laurent Perrier"
            email="laurent@creative-tim.com"
          />
        ),
        usertype: <Job title="Service Provider" description="" />,
        status: (
          <MDBox ml={-1}>
            <MDBadge
              badgeContent="ACTIVE"
              color="success"
              variant="gradient"
              size="sm"
            />
          </MDBox>
        ),
        JOINED: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            19/09/17
          </MDTypography>
        ),
        action: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            Deactivate
          </MDTypography>
        ),
      },
      {
        user: (
          <Author
            image={team3}
            name="Michael Levi"
            email="michael@creative-tim.com"
          />
        ),
        usertype: <Job title="Service Provider" description="" />,
        status: (
          <MDBox ml={-1}>
            <MDBadge
              badgeContent="ACTIVE"
              color="success"
              variant="gradient"
              size="sm"
            />
          </MDBox>
        ),
        JOINED: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            24/12/08
          </MDTypography>
        ),
        action: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            Deactivate
          </MDTypography>
        ),
      },
      {
        user: (
          <Author
            image={team3}
            name="Richard Gran"
            email="richard@creative-tim.com"
          />
        ),
        usertype: <Job title="Client" description="" />,
        status: (
          <MDBox ml={-1}>
            <MDBadge
              badgeContent="INACTIVE"
              color="dark"
              variant="gradient"
              size="sm"
            />
          </MDBox>
        ),
        JOINED: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            04/10/21
          </MDTypography>
        ),
        action: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            Activate
          </MDTypography>
        ),
      },
      {
        user: (
          <Author
            image={team4}
            name="Miriam Eric"
            email="miriam@creative-tim.com"
          />
        ),
        usertype: <Job title="Service Provider" description="" />,
        status: (
          <MDBox ml={-1}>
            <MDBadge
              badgeContent="INACTIVE"
              color="dark"
              variant="gradient"
              size="sm"
            />
          </MDBox>
        ),
        JOINED: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            14/09/20
          </MDTypography>
        ),
        action: (
          <MDTypography
            component="a"
            href="#"
            variant="caption"
            color="text"
            fontWeight="medium"
          >
            Activate
          </MDTypography>
        ),
      },
    ],
  };
}

export default usersData;
